import React from 'react';
import {Card, Avatar} from 'antd';

const UserProfile = () => {
  return (
    <Card
      actions = {[
        <div key="twit">술술<br />4</div>,
        <div key="following">팔로잉<br />10</div>,
        <div key="follower">팔로워<br />5</div>,
      ]}
    >
      <Card.Meta
        avatar = {<Avatar>DS</Avatar>}
        title = "dionysus"
      />
      <Button>로그아웃</Button>
    </Card>
  );
};

export default UserProfile;
